@RuiiPlume 3. The battery. Procreate drinks up a charge like water. 
I've had to end drawing sessions prematurely to let it charge. 
4. Storage, but not an issue if you use Dropbox or transfer files often.

@RuiiPlume Cons:
1. The Apple Pencil is nice quality but isn't as ergonomic as my tablet pen. 
2. I'm still very used to/prefer my desktop programs, and Procreate feels like an almost-there rather than a replacement. Also, CSP isn't as nice on iOS and is a subscription service.

